import React from "react";
import { ListItem, ListItemText } from "@mui/material";
import StarBorderIcon from '@mui/icons-material/StarBorder';
import StarIcon from '@mui/icons-material/Star';
import { makeStyles } from '@mui/styles';

const CustomListItem = ({ workout, onClick }) => {
    const classes = useStyles();
    
    return (
        <ListItem className={classes.listItem} onClick={onClick}>
            <StarBorderIcon className={classes.starIcon} />
            <ListItemText primary={workout.title} secondary={`${workout.description} - ${workout.daysPerWeek} days per week`} />
            <div className={classes.imageContainer}>
                <img src={workout.image} alt={workout.title} className={classes.image} />
            </div>
        </ListItem>
    );
};

const useStyles = makeStyles((theme) => ({
    listItem: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
    },
    starIcon: {
        marginRight: theme.spacing(2),
    },
    imageContainer: {
        flexShrink: 0,
        marginLeft: theme.spacing(2),
    },
    image: {
        width: 50, // Adjust as needed
        height: 50, // Adjust as needed
        borderRadius: theme.shape.borderRadius,
    },
}));

export default CustomListItem;
